/* eslint-disable react-hooks/rules-of-hooks */
import { useContext } from "react";
import { useNavigate } from "react-router-dom";
import { cartContext } from "../../contexts/cartContext";

const cart = () => {
const cart = useContext(cartContext);

const navigate = useNavigate();

const eliminarProducto = (idEliminar) => {
    cart.setcart(
    cart.cart.filter((elemento) => elemento.id !== idEliminar)
    );
};

    return cart.cart.length > 0 ? (
        <div className="container">
        <div className="row">
            <div className="col-sm-12 col-md-10 col-md-offset-1">
            <table className="table table-hover">
                <thead>
                <tr>
                    <th>Carta</th>
                    <th>Cantidad</th>
                    <th className="text-center">Precio</th>
                    <th> </th>
                    <th> </th>
                </tr>
                </thead>
                <tbody>
                {
                    //Lista de productos
                }
                {cart.cart.map((producto) => {
                    return (
                    <tr key={producto.id}>
                        <td className="col-sm-8 col-md-6">
                        <div className="media">
                            <a className="thumbnail pull-left" href="#">
                            {" "}
                            <img
                                className="media-object imagen-cart"
                                src={`http://localhost:8080/api/files/images/${producto.imagen}`}
                            ></img>{" "}
                            </a>
                            <div className="media-body">
                            <h4 className="media-heading">
                                <a href="#">{producto.nombre}</a>
                            </h4>
                            </div>
                        </div>
                        </td>
                        <td className="col-sm-1 col-md-1">
                        <input
                            type="email"
                            className="form-control"
                            id="exampleInputEmail1"
                            value={producto.cantidad}
                            readOnly={true}
                        ></input>
                        </td>
                        <td className="col-sm-1 col-md-1 text-center">
                        <strong>{producto.cantidad * producto.precio}€</strong>
                        </td>
                        <td> </td>
                        <td className="col-sm-1 col-md-1">
                        <button
                            type="button"
                            className="btn btn-danger"
                            onClick={() => eliminarProducto(producto.id)}
                        >
                            <span className="glyphicon glyphicon-remove"></span>{" "}
                            Eliminar
                        </button>
                        </td>
                    </tr>
                    );
                })}

                <tr>
                    <td>   </td>
                    <td>   </td>
                    <td>   </td>
                    <td>
                    <h3>Total</h3>
                    </td>
                    <td className="text-right">
                    <h3>
                        <strong>
                        {cart.cart.reduce(
                            (total, producto) => total + producto.precio,
                            0
                        )}
                        €
                        </strong>
                    </h3>
                    </td>
                </tr>
                <tr>
                    <td>   </td>
                    <td>   </td>
                    <td>   </td>
                    <td>
                    <button type="button" className="btn btn-default">
                        Continue Shopping
                    </button>
                    </td>
                    <td>
                    <button type="button" className="btn btn-success">
                        Checkout
                    </button>
                    </td>
                </tr>
                </tbody>
            </table>
            </div>
        </div>
        </div>
    ) : (
        <button
        onClick={() => navigate("/", { replace: true })}
        type="button"
        className="btn btn-default"
        >
        Continue Shopping
        </button>
    );
};

export default cart;
